import React from "react";
import "../styles/Header.scss";
import "../styles/ActionMenu.scss";
import Button from "@material-ui/core/Button";

export default function ActionMenu(props) {
  return (
    <div className="HeaderWrapper">
      <h2>Maak uw keuze:</h2>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <Button
          color="primary"
          variant="contained"
          style={{
            height: "60px",
            minWidth: "100px",
            display: "block",
            marginBottom: "50px",
          }}
        >
          {"Inslag"}
        </Button>
        <Button
          color="primary"
          variant="contained"
          style={{
            height: "60px",
            minWidth: "100px",
            display: "block",
          }}
        >
          {"Uitslag"}
        </Button>
      </div>
    </div>
  );
}
